INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('ce2549c3-26c6-4a7a-80f1-39170c8d7120','ACTION ORIENTED','Action Oriented Enjoys working hard; is action oriented and full of energy for the things he/she sees as challenging; not fearful of acting with a minimum of planning; seizes more opportunities than others.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('58a99e35-d39e-4807-a9fe-974535cc61b1','APPROACHABILITY','Approachability Is easy to approach and talk to; spends the extra effort to put others at ease; can be warm, pleasant, and gracious; is sensitive to and patient with the interpersonal anxieties of others; builds rapport well; is a good listener; is an early knower, getting informal and incomplete information in time to do something about it.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('12b29845-c564-4f1b-8703-f856833aff77','BOSS RELATIONSHIPS','Boss Relationships Responds and relates well to bosses; would work harder for a good boss; is open to learning from bosses who are good coaches and who provide latitude; likes to learn from those who have been there before; easy to challenge and develop; is comfortably coachable.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('f072c665-ba6d-465e-a334-88eb07934b5a','BUILDING EFFECTIVE TEAMS','Building Effective Teams Blends people into teams when needed; creates strong morale and spirit in his/her team; shares wins and successes; fosters open dialogue; lets people finish and be responsible for their work; defines success in terms of the whole team; creates a feeling of belonging in the team.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('19651651-ccee-4ca8-b8fd-1172ca4c462e','BUSINESS ACUMEN','Business Acumen Knows how businesses work; knowledgeable in current and possible future policies, practices, trends, and information affecting his/her business and organization; knows the competition; is aware of how strategies and tactics work in the marketplace.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('208fa3a8-4f3b-4425-a7b5-3b92019c51f8','CAREER AMBITION','Career Ambition Knows what he/she wants from a career and actively works on it; is career knowledgeable; makes things happen for self; markets self for opportunities; doesn�t wait for others to open doors.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('a0f8f039-6124-4386-ade1-3700f29762d5','CARING ABOUT DIRECT REPORTS','Caring About Direct Reports Is interested in the work and non-work lives of direct reports; asks about their plans, problems, and desires; knows about their concerns and questions; is available for listening to personal problems; monitors workloads and appreciates extra effort.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('b3c96480-e1ef-4cab-91e7-e61359fc227b','COMFORT AROUND HIGHER MANAGEMENT','Comfort Around Higher Management Can deal comfortably with more senior managers; can present to more senior managers without undue tension and nervousness; understands how senior managers think and work; can determine the best way to get things done with them by talking their language and responding to their needs; can craft approaches likely to be seen as appropriate and positive.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('0d00f9ea-5a68-4af2-94df-b41b3635c04e','COMMAND SKILLS','Command Skills Relishes leading; takes unpopular stands if necessary; encourages direct and tough debate but isn�t afraid to end and move on; is looked to for direction in a crisis; faces adversity head on; energized by tough challenges.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('5fe08279-a462-4dab-97ae-a3b9a42c774b','COMPASSION','Compassion Genuinely cares about people; is concerned about their work and non-work problems; is available and ready to help; is sympathetic to the plight of others not as fortunate; demonstrates real empathy with the joys and pains of others.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('8f78cac9-8b3d-438d-b296-97943f0c8f20','COMPOSURE','Composure Is cool under pressure; does not become defensive or irritated when times are tough; is considered mature; can be counted on to hold things together during tough times; can handle stress; is not knocked off balance by the unexpected; doesn�t show frustration when resisted or blocked; is a settling influence in a crisis.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('45ca0ebe-86e4-4d8c-ab23-afc0960fd60f','CONFLICT MANAGEMENT','Conflict Management Steps up to conflicts, seeing them as opportunities; reads situations quickly; good at focused listening; can hammer out tough agreements and settle disputes equitably; can find common ground and get cooperation with minimum noise.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('e1bb56d6-f395-4825-95d2-d23d10a91096','CONFRONTING DIRECT REPORTS','Confronting Direct Reports Deals with problem direct reports firmly and in a timely manner; doesn�t allow problems to fester; regularly reviews performance and holds timely discussions; can make negative decisions when all other efforts fail; deals effectively with troublemakers.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('9fa36056-0199-40bc-b9af-51064530d68f','CREATIVITY','Creativity Comes up with a lot of new and unique ideas; easily makes connections among previously unrelated notions; tends to be seen as original and value-added in brainstorming settings.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('baae2338-ab24-4440-8f02-9f8155d9b371','CUSTOMER FOCUS','Customer Focus Is dedicated to meeting the expectations and requirements of internal and external customers; gets first-hand customer information and uses it for improvements in products and services; acts with customers in mind; establishes and maintains effective relationships with customers and gains their trust and respect.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('b5151126-d43f-408e-a711-0fd06fe6075e','DEALING WITH AMBIGUITY','Dealing With Ambiguity Can effectively cope with change; can shift gears comfortably; can decide and act without having the total picture; isn�t upset when things are up in the air; doesn�t have to finish things before moving on; can comfortably handle risk and uncertainty.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('afc0c1be-d0b4-48e4-98e3-97345612e81c','DEALING WITH PARADOX','Dealing With Paradox Can act in ways that seem contradictory; is very flexible and adaptable when facing tough calls; can combine seeming opposites like being compassionately tough, stand up for self without trampling others, set strong but flexible standards; can act differently depending upon the situation; is seen as balanced despite the conflicting demands of the situation.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('ff4669e1-37b5-4d9f-905e-2b5db866ab2f','DECISION QUALITY','Decision Quality Makes good decisions (without considering how much time it takes) based upon a mixture of analysis, wisdom, experience, and judgment; most of his/her solutions and suggestions turn out to be correct and accurate when judged over time; sought out by others for advice and solutions.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('abb96cec-5d52-49ed-bf91-39d051336ff8','DELEGATION','Delegation Clearly and comfortably delegates both routine and important tasks and decisions; broadly shares both responsibility and accountability; tends to trust people to perform; lets direct reports finish their own work.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('fbaca29f-18f2-40ce-b617-cb193d25c1de','DEVELOPING DIRECT REPORTS AND OTHERS','Developing Direct Reports Provides challenging and stretching tasks and assignments; holds frequent development discussions; is aware of each direct report�s career goals; constructs compelling development plans and executes them; pushes direct reports to accept developmental moves; will take direct reports who need work; is a people builder.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('624da332-cc2b-457c-a2be-f20caf0f775a','DIRECTING OTHERS','Directing Others Is good at establishing clear directions; sets stretching objectives; distributes the workload appropriately; lays out work in a well-planned and organized manner; maintains two-way dialogue with others on work and results; brings out the best in people; is a clear communicator. Click for learning program...','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('bf997d9d-5094-47b0-9487-ddc600e34453','DRIVE FOR RESULTS','Drive For Results Can be counted on to exceed goals successfully; is constantly and consistently one of the top performers; very bottom-line oriented; steadfastly pushes self and others for results.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('7c4dc011-eecd-4113-9e5c-7e0c316011ce','ETHICS AND VALUES','Ethics and Values Adheres to an appropriate (for the setting) and effective set of core values and beliefs during both good and bad times; acts in line with those values; rewards the right values and disapproves of others; practices what he/she preaches.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('b8768ae8-bbcc-45e1-bfe6-db07cc56f911','FAIRNESS TO DIRECT REPORTS','Fairness to Direct Reports Treats direct reports equitably; acts fairly; has candid discussions; doesn�t have hidden agenda; doesn�t give preferential treatment.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('5973f316-b256-430b-8d4c-5db923f71fd4','FUNCTIONAL OR TECHNICAL SKILLS','Functional/Technical Skills Has the functional and technical knowledge and skills to do the job at a high level of accomplishment.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('8bc3872d-35fa-4977-941d-a49665f78fbc','HIRING AND STAFFING','Hiring and Staffing Has a nose for talent; hires the best people available from inside or outside; is not afraid of selecting strong people; assembles talented staffs.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('526e4d16-59c8-4402-b9cc-a6491437b4e2','HUMOR','Humor Has a positive and constructive sense of humor; can laugh at him/herself and with others; is appropriately funny and can use humor to ease tension.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('6c602d80-eb6b-4b0b-b29d-60312881a555','INFORMING','Informing Provides the information people need to know to do their jobs and to feel good about being a member of the team, unit, and/or the organization; provides individuals information so that they can make accurate decisions; is timely with information','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('e5d8f653-d82b-4d55-90ad-45182c384f72','INNOVATION MANAGEMENT','Innovation Management Is good a bringing the creative ideas of others to market; has good judgment about which creative ideas and suggestions will work; has a sense about managing the creative process of others; can facilitate effective brainstorming; can project how potential ideas may play out in the marketplace.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('9e41f1b5-b26f-42fc-9ad8-e07d4702b1ef','INTEGRITY AND TRUST','Integrity and Trust Is widely trusted; is seen as a direct, truthful individual; can present the unvarnished truth in an appropriate and helpful manner; keeps confidences; admits mistakes; doesn�t misrepresent him/herself for personal gain.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('b5533234-fe7d-4138-b917-d62f4a37f9ce','INTELLECTUAL HORSEPOWER','Intellectual Horsepower Is bright and intelligent; deals with concepts and complexity comfortably; described as intellectually sharp, capable, and agile.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('df7bbeb2-2d9e-4fd5-accf-a80cf669eab8','INTERPERSONAL SAVVY','Interpersonal Savvy Relates well to all kinds of people, up, down, and sideways, inside and outside the organization; builds appropriate rapport; builds constructive and effective relationships; uses diplomacy and tact; can diffuse even high-tension situations comfortably.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('dd25f731-aa8b-4dd3-b346-1e8f7afec50f','LEARNING ON THE FLY','Learning on the Fly Learns quickly when facing new problems; a relentless and versatile learner; open to change; analyzes both successes and failures for clues to improvement; experiments and will try anything to find solutions; enjoys the challenge of unfamiliar tasks; quickly grasps the essence and the underlying structure of anything.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('99d59013-3646-4da2-9310-015992250132','LISTENING','Listening Practices attentive and active listening; has the patience to hear people out; can accurately restate the opinions of others even when he/she disagrees.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('6150465f-c00a-4007-a672-6952f8b265ca','MANAGERIAL COURAGE','Managerial Courage Doesn�t hold back anything that needs to be said; provides current, direct, complete, and �actionable� positive and corrective feedback to others; lets people know where they stand; faces up to people problems on any person or situation (not including direct reports) quickly and directly; is not afraid to take negative action when necessary.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('87512456-fe71-468d-a1cc-1c9aa999c8b0','MANAGING AND MEASURING WORK','Managing and Measuring Work Clearly assigns responsibility for tasks and decisions; sets clear objectives and measures; monitors process, progress, and results; designs feedback loops into work.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('563bf3f3-0760-474f-919b-beb0f08fe3b7','Managing Diversity','Managing Diversity Manages all kinds and classes of people equitably; deals effectively with all races, nationalities, cultures, disabilities, ages and both sexes; hires variety and diversity without regard to class; supports equal and fair treatment and opportunity for all.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('2b18325d-2b7f-4415-8a17-55d4469400ca','MANAGING THROUGH SYSTEMS','Managing Through Systems Can design practices, processes, and procedures which allow managing from a distance; is comfortable letting things manage themselves without intervening; can make things work through others without being there; can impact people and results remotely.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('e9eedadf-adc5-497b-87f7-5492cda83e37','MANGING VISION AND PURPOSE','Managing Vision and Purpose Communicates a compelling and inspired vision or sense of core purpose; talks beyond today; talks about possibilities; is optimistic; creates mileposts and symbols to rally support behind the vision; makes the vision shareable by everyone; can inspire and motivate entire units or organizations.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('625f9718-a624-47aa-9cdb-83ec67d5c654','MOTIVATING OTHERS','Motivating Others Creates a climate in which people want to do their best; can motivate many kinds of direct reports and team or project members; can assess each persons hot button and use it to get the best out of him/her; pushes tasks and decisions down; empowers others; invites input from each person and shares ownership and visibility; makes each individual feel his/her work is important; is someone people like working for and with.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('6966960b-1e34-4c48-97aa-88cb78e065d9','NEGOTIATING','Negotiating Can negotiate skillfully in tough situations with both internal and external groups; can settle differences with minimum noise; can win concessions without damaging relationships; can be both direct and forceful as well as diplomatic; gains trust quickly of other parties to the negotiations; has a good sense of timing.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('c797c397-13c6-43d2-bc6d-52b8bfc5398c','ORGANIZATIONAL AGILITY','Organizational Agility Knowledgeable about how organizations work; knows how to get things done both through formal channels and the informal network; understands the origin and reasoning behind key policies, practices, and procedures; understands the cultures of organizations.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('0a1ba4d9-dc8c-4658-b212-f083d23124e6','ORGAZINIG','Organizing Can marshal resources (people, funding, material, support) to get things done; can orchestrate multiple activities at once to accomplish a goal; uses resources effectively and efficiently arranges information and files in a useful manner.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('c612b156-923c-49e2-88e0-437e3c86755b','PATIENCE','Patience Is tolerant with people and processes; listens and checks before acting; tries to understand the people and the data before making judgments and acting; waits for others to catch up before acting; sensitive to due process and proper pacing; follows established process.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('2479a4ac-6619-49f8-a267-75c92e3cc892','PEER RELATIONSHIPS','Peer Relationships Can quickly find common ground and solve problems for the good of all; can represent his/her own interests and yet be fair to other groups; can solve problems with peers with a minimum of noise; is seen as a team player and is cooperative; easily gains trust and support of peers; encourages collaboration; can be candid with peers.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('a93a2b29-efd6-4c89-b044-7c6ef561466c','PERSEVERANCE','Perseverance Pursues everything with energy, drive, and a need to finish; seldom gives up before finishing, especially in the face of resistance or setbacks.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('9648992b-fb24-4d60-9a1c-72ab51f48586','PERSONAL DISCLOSURE','Personal Disclosure Shares his/her thoughts about personal strengths, weaknesses, and limitations; admits mistakes and shortcomings; is open about personal beliefs and feelings; is easy to get to know for those who interact with him/her regularly.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('51e1aaf9-e21a-45b1-9ff1-233255da6ec9','PERSONAL LEARNING','Personal Learning Picks up on the need to change personal, interpersonal, and managerial behavior quickly; watches others for their reactions to his/her attempts to influence and perform, and adjusts; seeks feedback; is sensitive to changing personal demands and requirements and changes accordingly.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('538c4321-8886-45c9-9f50-46d8bbb32c79','PERSPECTIVE','Perspective Looks toward the broadest possible view of an issue/challenge; has broad-ranging personal and business interests and pursuits; can easily pose future scenarios; can think globally; can discuss multiple aspects and impacts of issues and project them into the future.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('25f3d0e8-6873-433a-ad75-520bfeee9ce3','PLANNING','Planning Accurately scopes out length and difficulty of tasks and projects; sets objectives and goals; breaks down work into the process steps; develops schedules and task/people assignments; anticipates and adjusts for problems and roadblocks; measures performance against goals; evaluates results.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('e7acf1b5-41cb-44a7-af85-c7674c8c5d76','POLITICAL SAVY','Political Savvy Can maneuver through complex political situations effectively and quietly; is sensitive to how people and organizations function; anticipates where the land mines are and plans his/her approach accordingly; views corporate politics as a necessary part of organizational life and works to adjust to that reality; is a maze-bright person.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('ba640af2-0160-4d32-8220-9b9232f262a1','PRESENTATION SKILLS','Presentation Skills Is effective in a variety of formal presentation settings: one-on-one, small and large groups, with peers, direct reports, and bosses; is effective both inside and outside the organization, on both cool data and hot and controversial topics; commands attention and can manage group processes during the presentation; can change tactics midstream when something isn�t working.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('7571a512-26c4-46ea-9e0e-5529546e1339','PRIORITY SETTING','Priority Setting Spends his/her time and the time of others on what�s important; quickly zeros in on the critical few and puts the trivial many aside; can quickly sense what will help or hinder accomplishing a goal; eliminates roadblocks; creates focus.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('fa9db8d7-b7b4-4260-95a6-35ecfac32e88','PROBLEM SOLVING','Problem Solving Uses rigorous logic and methods to solve difficult problems with effective solutions; probes all fruitful sources for answers; can see hidden problems; is excellent at honest analysis; looks beyond the obvious and doesn''t stop at the first answers.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('ec291206-de8b-4d44-9c65-a3b4fe7ae866','PROCESS MANAGEMENT','Process Management Good at figuring out the processes necessary to get things done; knows how to organize people and activities; understands how to separate and combine tasks into efficient work flow; knows what to measure and how to measure it; can see opportunities for synergy and integration where others can''t; can simplify complex processes; gets more out of fewer resources.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('e53b4c35-3a04-4aee-b83d-ccc97ec6ee73','SELF-DEVELOPMENT','Self-Development Is personally committed to and actively works to continuously improve him/herself; understands that different situations and levels may call for different skills and approaches; works to deploy strengths; works on compensating for weakness and limits.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('529a0d83-bcf6-4432-b67e-da03ee031bf5','SELF-KNOWLEDGE','Self-Knowledge Knows personal strengths, weaknesses, opportunities, and limits; seeks feedback; gains insights from mistakes; is open to criticism; isn''t defensive; is receptive to talking about shortcomings; looks forward to balanced (+''s and -''s) performance reviews and career decisions.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('206dcbed-ed8f-427c-98c6-1aae464d5070','SIZING UP PEOPLE','Sizing Up People Is a good judge of talent; after reasonable exposure, can articulate the strengths and limitations of people inside or outside the organization; can accurately project what people are likely to do across a variety of situations.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('73ab4c11-5b79-4451-98ce-4410bdfa5e38','STANDING ALONE','Standing Alone Will stand up and be counted; doesn''t shirk personal responsibility; can be counted on when times are tough; willing to be the only champion for an idea or position; is comfortable working alone on a tough assignment.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('6e52b35f-7a5e-45e0-9d3f-82b9b3f4693b','STRATEGIC AGILITY','Strategic Agility Sees ahead clearly; can anticipate future consequences and trends accurately; has broad knowledge and perspective; is future oriented; can articulately paint credible pictures and visions of possibilities and likelihoods; can create competitive and breakthrough strategies and plans.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('78ffa40f-7099-40ef-a2d1-26c35c15e567','TECHNICAL LEARNING','Technical Learning Picks up on technical things quickly; can learn new skills and knowledge; is good at learning new industry, company, product, or technical knowledge; does well in technical courses and seminars.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('58cebd3c-7c1a-46c4-b2c6-9c6718ef54d0','TIME MANAGEMENT','Time Management Uses his/her time effectively and efficiently; values time; concentrates his/her efforts on the more important priorities; gets more done in less time than others; can attend to a broader range of activities.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('a2690c9e-e0a4-49f6-9820-a97024ea4bba','Timely Decision Making','Timely Decision Making Makes decisions in a timely manner, sometimes with incomplete information and under tight deadlines and pressure; able to make a quick decision.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('45cd831d-b2a7-4809-b24a-70f84f512780','TQM/RE-ENGINEERING','TQM/Re-Engineering Is dedicated to providing the highest quality products and services which meet the needs and requirements of internal and external customers; is committed to continuous improvement through empowerment and management by data; is willing to re-engineer processes from scratch; is open to suggestions and experimentation; creates a learning environment leading to the most efficient and effective work processes.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('a8c9ebae-9df9-48d6-8fda-3a8639ce0107','UNDERSTANDING OTHERS','Understanding Others Understands why groups do what they do; picks up the sense of the group in terms of positions, intentions, and needs; what they value and how to motivate them; can predict what groups will do across different situations.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('1f06b16e-5f58-4751-b0fa-ca9cf694710f','WORK/LIFE BALANCE','Work/Life Balance Maintains a conscious balance between work and personal life so that one doesn''t dominate the other; is not one-dimensional; knows how to attend to both; gets what he/she wants from both.','Lominger Compenticies',TRUE,NULL);
INSERT INTO skills(id,skill_name,description,category,is_certification,skill_levels) VALUES ('37fe6bf3-71c6-4e11-b85e-9496d883c356','WRITTEN COMMUNICATION','Written Communications Is able to write clearly and succinctly in a variety of communication settings and styles; can get messages across that have the desired effect.','Lominger Compenticies',TRUE,NULL);
